# Given a string, find the length of the longest substring without repeating characters.
#
# Examples:
#
# Given "abcabcbb", the answer is "abc", which the length is 3.
#
# Given "bbbbb", the answer is "b", with the length of 1.
#
# Given "pwwkew", the answer is "wke", with the length of 3. Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
#
# Subscribe to see which companies asked this question

class Solution(object):
	
	def lengthOfLongestSubstring(self, s):
		
		if len(s) <= 1:
			return len(s)
		
		max_len = 0
		longest_str_list = []
		for val in (s):
			if val not in longest_str_list:
				longest_str_list.append(val)
			else:
				if max_len < len(longest_str_list):
					max_len = len(longest_str_list)
				
				temp_list = list(longest_str_list)
				for v in longest_str_list:
					if val != v:
						temp_list.remove(v)
					else:
						temp_list.remove(v)
						temp_list.append(val)
						break
				longest_str_list = temp_list
				
		return max(max_len, len(longest_str_list))
		
